import React from "react";
import styled from "styled-components";

const Illustration = styled.div`
  width: calc(50% - 1rem);
  margin-right: 1rem;
  padding-top: 4rem;
  h1 {
    font-weight: 600;
    font-size: 50px;
    display: block;
    position: relative;
    width: 400px;
    padding: 1rem;
    margin: 0 auto;
  }
`;

const LeftSide = props => {
  return (
    <Illustration>
      <h1>
        Take an item.
        <br /> Share an item.
      </h1>
      <Table src="../static/table.svg"></Table>
    </Illustration>
  );
};

export default LeftSide;
